window.bookSummaryJSON = "<p>Isaac Icari—the God of Hazelwood University—my stepbrother, my lover, my enemy. It was dangerous to let myself be swept up by him, but he’s a drug that I crave. I should have walked away the second I realized what he was involved with, when he revealed who his father truly was. Now it’s too late. We should have known better. Get too close to the sun and you get burned. I have no one to blame but myself. He is my downfall, and I am his.</p>"; 
